INSERT INTO `sach` (`MASACHCHUNG`, `MASACH`, `TENSACH`, `THELOAI`, `TACGIA`, `TRANGTHAI`, `ANH`) VALUES
	('DBSblabla', '1231', 'Hannibal', 'Trinh thám', '123', 'Hannibal was a Carthaginian general, one of the great military leaders of antiquity12. He was born in 247 BCE in North Africa and died in 183-181 BCE in Libyssa, Bithynia2. He commanded the Carthaginian forces against Rome in the Second Punic War (218-201 BCE)12. He is famous for his crossing of the Alps with elephants and his victories at Cannae and Trasimene1. He is considered a master of strategy and tactics and his legacy is still influential today', _binary ),
	('DBS', 'DBS01', 'Utopia', 'Light novel', 'Akira Toriyama', 'Utopia is an ideal commonwealth whose inhabitants exist under seemingly perfect conditions1234. The word was coined by Sir Thomas More in his work Utopia (1516)14. The book describes an imaginary and perfect world, an ideally organized state4. It is a work in which More speculates about an idealized society on an island called Utopia3. The society can be thought of as the culmination of rational thought or Humanist beliefs, as an alternative to feudalism, as a statement in favor of communal society, or as an effort to promote reform according to Christian values', _binary ),
	('HNB', 'HNB2', '12 Angry Man', 'Trinh thám', 'Thomas Harris', '12 Angry Men is a courtroom drama that follows the deliberations of twelve jurors who have to decide the fate of a teenage boy accused of murdering his father1234. The boy faces a possible death penalty if found guilty12. The jurors have to overcome their personal biases, prejudices, and emotions that influence their judgment34. The film explores the themes of justice, democracy, and human nature4', _binary ),
	('HNB', 'HNB3', 'Fight Club', 'Trinh thám', 'Thomas Harris', 'Fight Club is a novel by Chuck Palahniuk that follows the Narrator, a discontented office worker who suffers from insomnia. He meets Tyler Durden, a charismatic soap maker, and together they create a secret underground club where men fight each other for fun and catharsis  The club grows into a violent anti-consumerist and anti-corporate movement called Project Mayhem, led by Tyler. The Narrator discovers that he and Tyler are the same person, suffering from dissociative identity disorder', _binary ),
	('HNB', 'HNB4', 'From London Far', 'Trinh thám', 'Thomas Harris', 'From London Far is a 1946 mystery thriller novel by the British writer Michael Innes. It is a standalone novel from the author who was best known for his series featuring the Golden Age detective John Appleby. Like much of Innes\' work it contains elements of farcical humour.', _binary );
INSERT INTO `sach` (`MASACHCHUNG`, `MASACH`, `TENSACH`, `THELOAI`, `TACGIA`, `TRANGTHAI`, `ANH`) VALUES
	('TCB', 'TCB1', 'The Truman Show', 'Light novel', 'Hanamori Yuki ', 'An insurance salesman discovers his whole life is actually a reality TV show. Since birth, a big fat lie defines the well-organised but humdrum life of the kind-hearted insurance salesman and ambitious explorer, Truman Burbank.', _binary ),
	('TN', 'TN01', 'Inception', 'Trinh thám', 'Kim Khánh', 'Inception is a 2010 American science fiction thriller film1. The movie explores the boundaries between dream and reality and centres on Dom Cobb, a skilled thief who invades targets’ dreams through a chemical-induced shared dream state in order to steal valuable information1234. Cobb is offered a chance to regain his old life as payment for a task considered to be impossible: "inception", the implantation of another person\'s idea into a target\'s subconscious23. The movie stars Leonardo DiCaprio as Dom Cobb', _binary ),
	('TN', 'TN02', 'The Night Ocean', 'Thiếu nhi', 'Kim Khánh', 'As a heartbroken Marina follows her missing husband\'s trail in an attempt to learn the truth, the novel moves across the decades and along the length of the continent, from a remote Ontario town, through New York and Florida to Mexico City. The Night Ocean is about love and deception - about the way that stories earn our trust, and betray it.', _binary ),
	('TN', 'TN03', 'Seven', 'Thiếu nhi', 'Kim Khánh', '"Seven" is a movie that tells the story of two detectives - one ready to retire, the other at the start of his career - and their attempts to capture a perverted serial killer who is using the Seven Deadly Sins as his scenario1. The film is not about detection; the killer turns himself in when the film still has half an hour to go2.', _binary ),
	('TN', 'TN04', 'Taxi Driver', 'Thiếu nhi', 'Kim Khánh', 'Taxi Driver is a haunting film set in New York City, following a Vietnam War veteran who works as a taxi driver. Robert De Niro delivers a chilling performance as the rage-filled antihero Travis Bickle. The movie explores themes of loneliness, societal decay, and descent into paranoia and violenc', _binary ),
	('TN', 'TN05', 'The Bass Rock', 'Thiếu nhi', 'Kim Khánh', 'The Bass Rock is a novel by Evie Wyld that explores the lives of three women across four centuries. Sarah, accused of being a witch, flees for her life in the early 1700s. The interwoven stories of these women are shaped by the men in their lives', _binary ),
	('TN', 'TN06', 'The Godfather', 'Thiếu nhi', 'Kim Khánh', 'The Godfather "Don" Vito Corleone is the head of the Corleone mafia family in New York. He is at the event of his daughter\'s wedding. Michael, Vito\'s youngest son and a decorated WWII Marine is also present at the wedding. Michael seems to be uninterested in being a part of the family business. Vito is a powerful man, and is kind to all those who give him respect but is ruthless against those who do not. But when a powerful and treacherous rival wants to sell drugs and needs the Don\'s influence for the same, Vito refuses to do it. What follows is a clash between Vito\'s fading old values and the new ways which may cause Michael to do the thing he was most reluctant in doing and wage a mob war against all the other mafia families which could tear the Corleone family apart.', _binary ),
	('TN', 'TN07', 'The Life Of Pi', 'Thiếu nhi', 'Kim Khánh', 'Life of Pi is a fantasy novel by Yann Martel that won the Booker Prize in 20021. It tells the story of Pi, a young Indian boy who survives a shipwreck and is lost at sea in a lifeboat with four wild animals: an orangutan, a zebra, a hyena, and a Bengal tiger named Richard Parker12. Pi struggles to survive and adapt to his harsh situation, abandoning his vegetarianism and fighting against his fate3.', _binary ),
	('TN', 'TN08', 'The Majesties', 'Thiếu nhi', 'Kim Khánh', 'In this riveting tale about the secrets and betrayals that can accompany exorbitant wealth, two sisters from a Chinese-Indonesian family grapple with the past after one of them poisons their entire family. Gwendolyn and Estella have always been as close as sisters can be.', _binary );

